pragma solidity ^0.4.17;

contract Mandiv{

  //structs
  struct Usuario{
    string nome;
    string senha;
    bool motorista;
    uint avaliacao;
  }

  //variaveis
  mapping(address=>Usuario) public usuarios;

  //eventos
  event loginEvent(
    string nome
  );

  //funcoes
  function cadastrar(string _nome, string _senha, bool _motorista) public {
    require(usuarios[msg.sender].avaliacao == 0);
    usuarios[msg.sender] = Usuario(_nome,_senha,_motorista,100);
  }

  function login(string _senha) public {
    require(compareStrings(usuarios[msg.sender].senha, _senha));
    emit loginEvent(usuarios[msg.sender].nome);
  }

  function compareStrings (string a, string b) view returns (bool){
       return keccak256(a) == keccak256(b);
   }
}
